import { React, useState } from 'react'
import '../index.css'
import Timeline from './Timeline.js'

export default function Projects() {

    const openInNewTab = url => {
        window.open(url, '_blank');
    };

    const [hovering1, setHovering1] = useState(false);

    const handleMouseOver1 = () => {
        setHovering1(true);
    };

    const handleMouseOut1 = () => {
        setHovering1(false);
    };

    const display1 = {
        color: hovering1 === true ? 'rgb(129, 126, 126)' : 'white'
    }

    return (

        <div style={{marginTop: "15%"}} className="experience-grid-center-projects">
            <button style={{marginTop: "0"}} className="experience-grid-center-projects-item"
                onClick={() => openInNewTab('https://google.com')}>
                <div className="project-item-header"
                onMouseOver={() => {setHovering1(true)}} 
                onMouseOut={() => {setHovering1(false)}}>
                    Application Website
                </div>
                <p className="project-item-tec">
                    React, JavaScript, HTML, CSS
                </p>
            </button>

            <button className="experience-grid-center-projects-item"
                onClick={() => openInNewTab('https://google.com')}>
                <div className="project-item-header">
                    ToDoIst - Clone
                </div>
                <p className="project-item-tec">
                    React, JavaScript, HTML, CSS
                </p>
            </button>

            <button className="experience-grid-center-projects-item"
                onClick={() => openInNewTab('https://google.com')}>
                <div className="project-item-header">
                    Classification Algorithm
                </div>
                <p className="project-item-tec">
                    R, Random Forest, XGBoost
                </p>
            </button>

            <button className="experience-grid-center-projects-item2">
                <div className="project-item-header2">
                    ... More Projects Coming Soon
                </div>
            </button>

        </div>
    )
}
